import React from "react";
import { Button, Input } from "../../components";

function CreateBlog() {
  return (
    <div>
      <p>Halaman create blog</p>
      <Input label="Pos Title"/>
      <p>uploade email</p>
      <textarea></textarea>
      <Button title="Sav"/>
    </div>
  );
}

export default CreateBlog;
